import React, {Component,Fragment} from 'react'
import Link from "next/link";

class Index extends Component {
  render() {

    return (
      <Fragment>
        <p>
          Go to{" "}
          <Link href="/">
            <a>Home</a>
          </Link>
        </p>
        <p>
          Go to{" "}
          <Link href="/about">
            <a>關於卡利</a>
          </Link>
        </p>
        <p>
          Go to{" "}
          <Link href="/online_baccarat">
            <a>online Baccarat</a>
          </Link>
        </p>
      </Fragment>

    )
  }
}

export default Index
